control.onControlLoad:
//鼠标点击行激活处理
g5.productId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 7; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 7; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.productId = null;
        return;
    }
    g5.productId = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.productName = g5.dataset1.getData(4, sender.rowIndex);
    g5.listPrice = g5.dataset1.getData(5, sender.rowIndex);
    g5.productNote = g5.dataset1.getData(6, sender.rowIndex);
}


//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
if (eb.isEmpty(g5.productId) || isNaN(g5.productId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newProductName = prompt("请输入新的商品名字：", g5.productName);
if (g5.newProductName == null) return;
if (g5.newProductName == g5.productName) return;
modifyName();

if (eb.isEmpty(g5.productId) || isNaN(g5.productId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

if (eb.isEmpty(g5.productId) || isNaN(g5.productId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newListPrice = prompt("请输入新的商品价格：", g5.listPrice);
if (g5.newListPrice == null) return;
if (g5.newListPrice == g5.listPrice) return;
modifyPrice();

if (eb.isEmpty(g5.productId) || isNaN(g5.productId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newProductNote = prompt("请输入新的商品备注：", g5.productNote);
if (g5.newProductNote == null) return;
if (g5.newProductNote == g5.productNote) return;
modifyNote();

if (eb.isEmpty(g5.productId) || isNaN(g5.productId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("商品上架将立即进入销售状态，您是否继续？")) {
    return;
}
modifyOnline();

if (eb.isEmpty(g5.productId) || isNaN(g5.productId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("商品上架将立即进入下架状态，您是否继续？")) {
    return;
}
modifyOffline();

control.onUpdate:
if (text == "IDL") {
    ee.setText(sender, "<font color = '#d03030'>销售</font>");
} else if (text == "OFL") {
    ee.setText(sender, "<font color = '#30a030'>下架</font>");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
condition += 
    " (companyId = " + companyId + ") " +
    " and (status <> 'DEL') ";
if (searchText != "") {
    condition +=
        " and (" +
        "(displayName like '%" + db.encode(searchText) + "%') or " +
        "(note like '%" + db.encode(searchText) + "%')) ";
}

sql =
    "SELECT count(*) as c " +
    "FROM product " +
    "WHERE " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT * " +
    "FROM product " +
    "WHERE  " + condition +
    "ORDER BY lastModifyTime DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,lastModifyTime,status,displayName,listPrice,note", pageSize*(pageCurrent-1), pageSize);

