var listPrice = ee.getEditText(ee.getControl("edit4"));
var note = ee.getEditText(ee.getControl("edit1"));

if (productName == "") {
    alert("商品名字必须填写");
    return;
}
listPrice = parseFloat(listPrice);
listPrice = parseInt(listPrice * 100);
if (isNaN(listPrice)) {
    alert("价格格式不正确");
    return;
}
if (listPrice < 0) {
    alert("价格不能是负数");
    return;
}

eio.appendString8(eb.getCookie("loginToken"));
eio.appendString8(productName);
eio.appendInt32(listPrice);
eio.appendString16(note);

